import requests
from bs4 import BeautifulSoup
import pandas as pd

container = soup.find_all('div', class_='css-1dbjc4n r-14lw9ot r-awg2lu r-1dzdj1l r-rs99b7 r-18u37iz r-1jbys1g r-1udh08x')

container[0].text

data= pd.DataFrame()
for page in range (2,10):
    print (f"proses pada page ke- {page}")
    url = f"https://www.traveloka.com/id-id/accommodation/apartment/indonesia/region/jakarta-102813/{page}"
    response = requests.get(url)
    soup = BeautifulSoup(response.text, 'html.parser')
    apartments =[]
    for item in soup.find_all('div', class_='css-1dbjc4n r-14lw9ot r-awg2lu r-1dzdj1l r-rs99b7 r-18u37iz r-1jbys1g r-1udh08x'):
        name = item.find('h3', class_='css-4rbku5 css-901oao css-cens5h r-a5wbuh r-ubezar r-1kfrs79 r-rjixqe r-fdjqy7').text.strip()  # Nama apartemen
        price = item.find('div', class_='css-901oao r-a5wbuh r-1kfrs79').text.strip()  # Harga apartemen
        location = item.find('div', class_='css-1dbjc4n r-1habvwh r-18u37iz r-1h0z5md').text.strip()  # Lokasi apartemen
        komentar = item.find('div', class_='css-1dbjc4n r-1udh08x').text.strip() if item.find('div', class_='css-1dbjc4n r-1udh08x') else None
        rating = item.find('div', class_='css-1dbjc4n r-1awozwy r-18u37iz r-1h0z5md').text.strip() if item.find('div', class_='css-1dbjc4n r-1awozwy r-18u37iz r-1h0z5md') else None
        apartments.append({
            'Nama Apartemen': name,
            'Harga': price,
            'Lokasi': location,
            'Komentar_pengunjung' : komentar,
            'Rating' : rating
        })

    # Mengubah data ke dalam DataFrame untuk ditampilkan dalam bentuk tabel
    df = pd.DataFrame(apartments)
    data=pd.concat([data,df])

data

data.reset_index(drop=True, inplace=True)
data

"""# 3. Cleaning Data

### * Mengcleaning kolom harga dengan menghilangkan "Rp" dan titik antar angka hingga dapat menjadi typedata integer.
"""

data['Harga'] = data['Harga'].replace({'Rp ': ''}, regex=True)
data

# Langkah 1: Membersihkan kolom harga: menghapus titik (.) pada harga
data['Harga'] = data['Harga'].str.replace('.', '', regex=False)

# Langkah 2: Pastikan tidak ada nilai kosong atau tidak valid
print("Nilai kosong sebelum konversi ke integer:", data['Harga'].isnull().sum())

# Langkah 3: Konversi kolom harga menjadi integer
data['Harga'] = pd.to_numeric(data['Harga'], errors='coerce')

# Periksa nilai yang gagal dikonversi
print("Nilai kosong setelah konversi ke integer:", data['Harga'].isnull().sum())

# Menampilkan hasil akhir DataFrame
data

data.info()

"""### membuang data yang NaN pada kolom rating"""

data_cleaned = data.dropna(subset=['Rating'])
data_cleaned

"""### mengekstrak kolom "rating" menjadi 3 kolom baru yaitu "ratings" , "total_review" dan "deskripsi" agar mudah untuk diolah dan di analisa lebih lanjut"""

data_cleaned[['Ratings', 'Total_Review', 'Deskripsi']] = data_cleaned['Rating'].str.extract(r'(\d+\.\d+)\s\(([\d,]+)\)\s(.+)')
data_cleaned

data_cleaned.drop(columns=['Rating'], inplace=True)

data_cleaned

data_cleaned = data_cleaned.dropna(subset=['Ratings'])
data_cleaned

data_cleaned.info()

"""### merubah tipedata dari kolom ratings dan total_review menjadi numerik agar mudah untuk di proses dan di olah"""

data_cleaned['Ratings'] = data_cleaned['Ratings'].astype(float)

data_cleaned['Total_Review'] = data_cleaned['Total_Review'].astype(int)

data_cleaned['Komentar_pengunjung'].fillna('Belum ada Ulasan', inplace=True)

data_cleaned.info()

